import { css } from "styled-components";

export const commonContainer = css``;

export const theme = {
    skyblue: "rgba(50, 175, 254)",
    ligthblue: "rgba(141, 212, 250, 0.2)",
    pink: "rgba(251, 21, 84)",
    navy: "rgba(2, 17, 29)",
    green: "rgba(44, 188, 170)",
  };

export default theme;
